CKEDITOR.plugins.setLang("a11yhelp","cs",{title:"Instrukce pro p\u0159\xedstupnost",contents:"Obsah n\xe1pov\u011bdy. Pro uzav\u0159en\xed tohoto dialogu stiskn\u011bte kl\xe1vesu ESC.",legend:[{name:"Obecn\xe9",items:[{name:"Panel n\xe1stroj\u016f editoru",legend:"Stiskn\u011bte${toolbarFocus} k proch\xe1zen\xed panelu n\xe1stroj\u016f. P\u0159ejd\u011bte na dal\u0161\xed a p\u0159edchoz\xed skupiny pomoc\xed TAB a SHIFT-TAB. P\u0159echod na dal\u0161\xed a p\u0159edchoz\xed tla\u010d\xedtko panelu n\xe1stroj\u016f je pomoc\xed \u0160IPKA VPRAVO nebo \u0160IPKA VLEVO. Stisknut\xedm mezern\xedku nebo kl\xe1vesy ENTER tla\u010d\xedtko aktivujete."},{name:"Dialogov\xe9 okno editoru",legend:"Uvnit\u0159 dialogov\xe9ho okna stiskn\u011bte TAB pro p\u0159esunut\xed na dal\u0161\xed pole, stiskn\u011bte SHIFT + TAB pro p\u0159esun na p\u0159edchoz\xed pole, stiskn\u011bte ENTER pro odesl\xe1n\xed dialogu, stiskn\u011bte ESC pro jeho zru\u0161en\xed. Pro dialogov\xe1 okna, kter\xe1 maj\xed mnoho karet stiskn\u011bte ALT + F10 pr oproch\xe1zen\xed seznamu karet. Pak se p\u0159esu\u0148te na dal\u0161\xed kartu pomoc\xed TAB nebo \u0160IPKA VPRAVO. Pro p\u0159esun na p\u0159edchoz\xed stiskn\u011bte SHIFT + TAB nebo \u0160IPKA VLEVO. Stiskn\u011bte MEZERN\xcdK nebo ENTER pro vybr\xe1n\xed str\xe1nky karet."},{name:"Kontextov\xe9 menu editoru",legend:"Stiskn\u011bte ${contextMenu} nebo kl\xe1vesu APPLICATION k otev\u0159en\xed kontextov\xe9ho menu. Pak se p\u0159esu\u0148te na dal\u0161\xed mo\u017enost menu pomoc\xed TAB nebo \u0160IPKY DOL\u016e. P\u0159esu\u0148te se na p\u0159edchoz\xed mo\u017enost pomoc\xed  SHIFT+TAB nebo \u0160IPKY NAHORU. Stiskn\u011bte MEZERN\xcdK nebo ENTER pro zvolen\xed mo\u017enosti menu. Podmenu sou\u010dasn\xe9 mo\u017enosti otev\u0159ete pomoc\xed MEZERN\xcdKU nebo ENTER \u010di \u0160IPKY DOLEVA. Kontextov\xe9 menu uzav\u0159ete stiskem ESC."},{name:"R\xe1me\u010dek seznamu editoru",legend:"Uvnit\u0159 r\xe1me\u010dku seznamu se p\u0159esunete na dal\u0161\xed polo\u017eku menu pomoc\xed TAB nebo \u0160IPKA DOL\u016e. Na p\u0159edchoz\xed polo\u017eku se p\u0159esunete SHIFT + TAB nebo \u0160IPKA NAHORU. Stiskn\u011bte MEZERN\xcdK nebo ENTER pro zvolen\xed mo\u017enosti seznamu. Stiskn\u011bte ESC pro uzav\u0159en\xed seznamu."},{name:"Li\u0161ta cesty prvku v editoru",legend:"Stiskn\u011bte ${elementsPathFocus} pro proch\xe1zen\xed li\u0161ty cesty prvku. Na dal\u0161\xed tla\u010d\xedtko prvku se p\u0159esunete pomoc\xed TAB nebo \u0160IPKA VPRAVO. Na p\u0159edchoz\xed polo\u017eku se p\u0159esunete pomoc\xed SHIFT + TAB nebo \u0160IPKA VLEVO. Stiskn\u011bte MEZERN\xcdK nebo ENTER pro vybr\xe1n\xed prvku v editoru."}]},{name:"P\u0159\xedkazy",items:[{name:" P\u0159\xedkaz Zp\u011bt",legend:"Stiskn\u011bte ${undo}"},{name:" P\u0159\xedkaz Znovu",legend:"Stiskn\u011bte ${redo}"},{name:" P\u0159\xedkaz Tu\u010dn\xe9",legend:"Stiskn\u011bte ${bold}"},{name:" P\u0159\xedkaz Kurz\xedva",legend:"Stiskn\u011bte ${italic}"},{name:" P\u0159\xedkaz Podtr\u017een\xed",legend:"Stiskn\u011bte ${underline}"},{name:" P\u0159\xedkaz Odkaz",legend:"Stiskn\u011bte ${link}"},{name:" P\u0159\xedkaz Skr\xfdt panel n\xe1stroj\u016f",legend:"Stiskn\u011bte ${toolbarCollapse}"},{name:"P\u0159\xedkaz pro p\u0159\xedstup k p\u0159edchoz\xedmu prostoru zam\u011b\u0159en\xed",legend:"Stiskn\u011bte ${accessPreviousSpace} pro p\u0159\xedstup k nejbli\u017e\u0161\xedmu nedosa\u017eiteln\xe9mu prostoru zam\u011b\u0159en\xed p\u0159ed st\u0159\xed\u0161kou, nap\u0159\xedklad: dva p\u0159ilehl\xe9 prvky HR. Pro dosa\u017een\xed vzd\xe1len\xfdch prostor\u016f zam\u011b\u0159en\xed tuto kombinaci kl\xe1ves opakujte."},{name:"P\u0159\xedkaz pro p\u0159\xedstup k dal\u0161\xedmu prostoru zam\u011b\u0159en\xed",legend:"Stiskn\u011bte ${accessNextSpace} pro p\u0159\xedstup k nejbli\u017e\u0161\xedmu nedosa\u017eiteln\xe9mu prostoru zam\u011b\u0159en\xed po st\u0159\xed\u0161ce, nap\u0159\xedklad: dva p\u0159ilehl\xe9 prvky HR. Pro dosa\u017een\xed vzd\xe1len\xfdch prostor\u016f zam\u011b\u0159en\xed tuto kombinaci kl\xe1ves opakujte."},{name:" N\xe1pov\u011bda p\u0159\xedstupnosti",legend:"Stiskn\u011bte ${a11yHelp}"}]}]});